import React, { useRef, useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function ChatPage() {
    const navigate = useNavigate();

    useEffect(() => {
        if(localStorage.getItem('token') === null)
            navigate("/")
    });

    return (
        <>
            <div>CHAT PAGE</div>
        </>
    )
}
